import React, { useEffect, useState } from 'react';
import './index.css';
import Dashboard from './Dashboard/dashboard';
import ApiKeys from './API Keys/apikeys';
import Sdk from './SDKs/sdk';
import Deployments from './Deployments/deployments';
import Wizard from './Wizard/wizard';
import Sidebar from '../Sidebar/sidebar'

function MainContent(props) {
  const [active, setActive] = useState('dashboard'); // Initial value can be 'dashboard' or any other default value
  const {userData} = props 
  const{email} = userData
  // const activeComponent = () => {
  //   setActive(active);
  // }

  // useEffect(() => {
  //   activeComponent(); 
  // }, [active])

  return (
    <>
      <Sidebar setActive={setActive} />
      <div className="main-container">
      {active === 'dashboard' && <Dashboard email={email} />}
      {active === 'apiKeys' && <ApiKeys email={email} />}
      {active === 'sdk' && <Sdk email={email} />}
      {active === 'deployments' && <Deployments email={email} />}
      {active === 'wizard' && <Wizard email={email} />}
    </div>
    </>
  );
}

export default MainContent;
